commit_message:
Fixed the incorrect exchange merging introduced by the previous commit;
updated the IntroHashPartitionMergeExchange rule to handle the
hash-merge-exchange operator.

Rename ImmediateScheduler to SynchronousScheduler;
Remove orphaned class LSMMergeInProgressException


git-svn-id: https://hyracks.googlecode.com/svn/branches/hyracks_lsm_tree@2614 123451ca-8445-de46-9d55-352943316053

getWrite/ReadDevices returns Set instead of List;
RTree IO operations now also returns buddy btree devices;
hid merge/flush behind internal interface;



git-svn-id: https://hyracks.googlecode.com/svn/branches/hyracks_lsm_tree@2611 123451ca-8445-de46-9d55-352943316053

removed unnecessary retrying of inserts code from LSMHarness and ILSMIndexes;
added ILSMIndexInternal interface that the ILSMHarness uses to talk to
ILSMIndexes (internally) -- this allows properly exposed interfaces to an
"outside" user;



git-svn-id: https://hyracks.googlecode.com/svn/branches/hyracks_lsm_tree@1954 123451ca-8445-de46-9d55-352943316053

made naming of ILSMIndexAccessor implementations consistent;
removed unused IIndexBulkloadContext interface;
made AntimatterAwareTupleAccesor a singleton;
miscellaneous cleanup in each of the ILSMIndex implementations;



git-svn-id: https://hyracks.googlecode.com/svn/branches/hyracks_lsm_tree@1953 123451ca-8445-de46-9d55-352943316053

Removed unused package edu.uci.ics.hyracks.storage.am.common.lifecycle;
Removed usesless IndexType class;
Removed duplicate copy of IExperimentRunner;
Removed getIOManager() call from ILSMIndexFileManager;
IIndexOperationContext: startOperation() --rename--> setOperation();
Changed ILSMIOOperationScheduler.scheduleOperation() to throw HyracksDataException;



git-svn-id: https://hyracks.googlecode.com/svn/branches/hyracks_lsm_tree@1946 123451ca-8445-de46-9d55-352943316053

Update issue #52: 

- rewrote the aggregator interface to create a state factory; 
- added a wrapper interface for aggregation and changed the original aggregators to be field aggregators, and added a multi-field aggregator wrapper;
- rewrote test cases for new interface; 
- added count field aggregator.

git-svn-id: https://hyracks.googlecode.com/svn/branches/aggregators_dev_next@879 123451ca-8445-de46-9d55-352943316053

Added external hash group operator. Main changes include: 
- added external hash group operator and its helper hash table class, and test cases; 
- modified aggregator factories to support external group operator;
- added some aggregators (min/max, sum);
- added a plain file writer to output plain text onto disk.

